// src/pages/Tutor/TutorHome.jsx
import React, { useEffect, useState } from 'react';
import { Card, ListGroup, Button } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import api from '../../services/api';

const formatDateTime = iso =>
  new Date(iso).toLocaleString('pt-BR', {
    day: '2-digit',
    month: '2-digit',
    year: 'numeric',
    hour: '2-digit',
    minute: '2-digit',
  });

export default function TutorHome() {
  const navigate = useNavigate();
  const [pets, setPets] = useState([]);
  const [selectedPet, setSelectedPet] = useState(null);
  const [eventos, setEventos] = useState([]);

  useEffect(() => {
    const tutorJson = localStorage.getItem('usuario_tutor');
    if (!tutorJson) {
      alert('Voc√™ precisa estar logado como tutor.');
      navigate('/login-tutor');
      return;
    }

    const tutor = JSON.parse(tutorJson);
    api.get(`/pets?tutor=${tutor._id}`).then(res => setPets(res.data));
    api.get('/eventos').then(res => setEventos(res.data));
  }, []);

  const handleCheckOut = async (id) => {
    try {
      await api.put(`/eventos/${id}/checkout`, {
        dataSaida: new Date().toISOString(),
        observacoes: 'Checkout realizado com sucesso',
      });
      const res = await api.get('/eventos');
      setEventos(res.data);
    } catch (err) {
      alert('Erro ao realizar checkout');
    }
  };

  const eventosDoPet = selectedPet
    ? eventos.filter(e => e.pet === selectedPet._id)
    : [];

  return (
    <div className="container mt-4">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h3>Painel do Tutor</h3>
        <Button variant="danger" onClick={() => {
          localStorage.removeItem('usuario_tutor');
          navigate('/');
        }}>Sair</Button>
      </div>

      <div className="row">
        <div className="col-md-4">
          <Card className="shadow-sm rounded-4">
            <Card.Header className="fw-bold bg-white border-bottom">
              Meus Pets
            </Card.Header>
            <ListGroup variant="flush">
              <ListGroup.Item action active={!selectedPet} onClick={() => setSelectedPet(null)}>
                Todos Pets
              </ListGroup.Item>
              {pets.map(p => (
                <ListGroup.Item
                  key={p._id}
                  action
                  active={selectedPet?._id === p._id}
                  onClick={() => setSelectedPet(p)}
                >
                  {p.nome}
                </ListGroup.Item>
              ))}
              <ListGroup.Item action onClick={() => navigate('/tutor/pets/novo')}>
                üêæ Novo pet testes Cadastros
              </ListGroup.Item>
            </ListGroup>
          </Card>
        </div>

        <div className="col-md-8">
          <Card className="shadow-sm rounded-4">
            <Card.Header className="d-flex justify-content-between align-items-center bg-white border-bottom">
              <strong>Meus Eventos</strong>
              {selectedPet && (
                <Button
                  size="sm"
                  variant="success"
                  onClick={() => navigate(`/tutor/eventos/novo/${selectedPet._id}`)}
                >
                  Check-in
                </Button>
              )}
            </Card.Header>
            <ListGroup variant="flush">
              {eventosDoPet.map(e => (
                <ListGroup.Item key={e._id} className="py-3">
                  <div>
                    <strong>{e.tipo}</strong> ‚Äî <br />
                    Entrada: {formatDateTime(e.dataEntrada)} <br />
                    Sa√≠da: {e.dataSaida ? formatDateTime(e.dataSaida) : '‚Äî'} <br />
                    Status: {e.status} <br />
                    {e.observacoes && (
                      <div><small><em>Obs:</em> {e.observacoes}</small></div>
                    )}
                    {e.status === 'Ativo' && (
                      <div className="mt-2">
                        <Button size="sm" variant="warning" onClick={() => handleCheckOut(e._id)}>
                          Check-out
                        </Button>
                      </div>
                    )}
                  </div>
                </ListGroup.Item>
              ))}
            </ListGroup>
          </Card>
        </div>
      </div>
    </div>
  );
}
